    north_cards = [(mk[card[0]], card[1]) for card in north_cards]
    east_cards = [(mk[card[0]], card[1]) for card in east_cards]
    south_cards = [(mk[card[0]], card[1]) for card in south_cards]
    west_cards = [(mk[card[1]], card[1]) for card in west_cards]
    all_cards = [north_cards, east_cards, south_cards, west_cards]
    ns_score = 0
    ew_score = 0
    for i in range(13):
        max_value = -1
        winner_index = -1
        lead_suit = all_cards[0][i][1]
        for j in range(4):
            card_value = all_cards[j][i][0]
            card_suit = all_cards[j][i][1]
            if card_suit == trump:
                card_value += 100
            elif card_suit == lead_suit:
                card_value += 50
            if card_value > max_value:
                max_value = card_value
                winner_index = j
        if winner_index % 2 == 0:
            ns_score += 1
        else:
            ew_score += 1
    if ns_score > 6:
        winner = 'NS'
        score = ns_score - 6
    else:
        winner = 'EW'
        score = ew_score - 6
    return (winner, score)

